INSERT INTO `terms_condition` VALUES (1,'<div class=\"row\">\r\n                \r\n                <div class=\"col-lg-12\">\r\n                    <p>This document is an electronic record in terms of The Information Technology Act, 2000 (\"IT Act\") and rules thereunder, and is published in accordance with the provisions of Rule 3 (1) under Information Technology Rules which mandates for publishing of rules and regulations, privacy policy and terms of use for access or usage of the Website. This electronic record is generated by a computer system and does not require any physical or digital signatures. </p>\r\n<p>The domain name _____ (\"Website\") is an e-commerce portal owned and operated by SAHYADRI FARMERS PRODUCER COMPANY LTD (\"Sahyadri Farms\"), a company incorporated under the Indian Companies Act, having its registered office at Sr No 1102/08, Behind Police Head Quarter, Adgaon, Nashik 422003.</p>\r\n<p>Your use / access of the Website, its related sites and hyperlinks, shall be governed by the terms and conditions, policies, rules of Sahyadri Farms (\"Terms\") posted on the Website from time to time. These Terms applies to all users (whether Registered user or Guest User) of the Website. </p>\r\n<p>Please read the Terms and conditions very carefully before using the Website as your use of the Website is subject to your acceptance of and compliance with the Terms. If you do not agree or are not willing to be bound by the terms and conditions of this User Agreement and any Rules and Policies of Sahyadri Farms, please do not click on the \"I Accept\" button/check box and on the \"Continue\" button or \"Pay Now\" button and do not subscribe or seek to obtain access to or otherwise use the Website. </p>\r\n<p>By subscribing to or using the website or any of our services through the Website you agree that you have read, understood and are bound by the Terms, Policies, directions of Sahyadri Farms regardless of how you subscribe to or use the Website. This Agreement comes into effect upon your \"Acceptance\" of these terms and conditions (\"Terms\") however Sahyadri Farms at its sole discretion reserves its right not to accept a user from registering on the Website without assigning any reason thereof. </p>\r\n\r\n<div class=\"my-3\">\r\n<h4>DEFINITION </h4>\r\n<p>\"Agreement\" means the terms and conditions as detailed herein including all schedules, appendices, annexures, Privacy Policy, Disclaimer and will include the references to this Agreement as amended, novated, supplemented, varied or replaced from time to time. </p>\r\n<p>\"You\"/ \"User\" shall mean the end user accessing the Website, its contents and using the services offered through the Website. </p>\r\n<p>\"Sahyadri Farms\"/ \"we\"/ \"us\"/ \"our\" shall mean SAHYADRI FARMERS PRODUCER COMPANY LTD or its affiliates, franchisees, service providers, successors and assigns \"Site\" means the online shopping platform owned and operated by SAHYADRI FARMERS PRODUCER COMPANY LTD(\"_______\"), which provides a venue to the users of ________ to buy the Products listed on Site. </p>\r\n<p>\"Customer\"/\"Buyer\" shall mean the person or any legal entity who access the Website and places an order for and or purchases any products /services against the invitation of offer for sale of products / services on the Website. </p>\r\n<p>\"Acceptance\" shall mean your affirmative action in clicking on \"Checkout\" and on the \"continue button as provided on the registration page or clicking on \"Pay Now\" button while transacting as User or such other actions that implies your acceptance. </p>\r\n<p>\"Product\" shall mean the Products offered for sale on the website from time to time.</p>\r\n<p>\"Delivery\" shall mean the physical delivery of goods under your order placed with us.</p>\r\n<p>\"Price\" means the price communicated at the time of order and confirmed by us.</p>\r\n<p>\"Payment Facility \" shall mean applicable mode of payments made available to User from time to time. </p>\r\n<p>\"Content\" means all text, graphics, user interfaces, visual interfaces, photographs, trademarks, logos, sounds, music, artwork and computer code collectively.</p>\r\nBy impliedly or expressly accepting this User Agreement, Policies and Terms, You also accept and agree to be bound by Rules, Policies and Terms of Sahyadri Farms as provided from time to time in its Website and corresponding hyperlinks. \r\n\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>Registration and Submission of personal details:</h4>\r\n<p>You can use the services offered by the Website as a \"Registered User\". As part of the registration process on the Site, Sahyadri Farms may collect certain personally identifiable information about you including first and last name, email address, mobile phone number and contact details, Postal code, Demographic profile (like your age, gender, occupation, education, address etc.) and information about the pages on the site you visit/access, the links you click on the site, the number of times you access the page and any such browsing information. As a Registered User, you are responsible for maintaining the confidentiality of your user id and password. You are also responsible for maintaining the confidentiality of your email id and mobile number and for restricting access to your computer, computer system and computer network, and you are responsible for all activities that occur under your user id and password, email id and mobile l number as the case may be. You agree to maintain and promptly update all data provided by you and to keep it true, accurate, current and complete. If you provide any information that is untrue, inaccurate, not current or incomplete or we have reasonable grounds to suspect that such information is untrue, inaccurate, not current or incomplete, or not in accordance with the Terms, we have the right to indefinitely suspend or terminate or block access of your user account with the Website and refuse to provide you with access to the Website. We will collect personally identifiable information about you only as part of a voluntary registration process, on-line survey, or contest or any combination thereof. \r\n</p>\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>User\'s Liability</h4>\r\n<p>You agree to comply with all applicable laws in connection with your use of the Website, and such further limitations as may be set forth in any written or on-screen notice from us. \r\nBy using the Website you represent that you are at least 18 years old. Our website is not directed to children under the age of 18. If we become aware that a child and/ or customer is under the age of 18 and has registered or using our Website, we are entitled to remove his or her account from our system and cancel any order placed by him or her.\r\nYou agree and undertake not to reverse engineer, modify, copy, distribute, transmit, display, perform, reproduce, publish, license, create derivative works from, transfer, or sell any information or software obtained from the Website. Reproduction, copying of the content for commercial or non-commercial purposes and unwarranted modification of data and information within the content of the Website is not permitted.</p>\r\n<p>You agree and undertake not to display, upload, modify, publish, transmit, update or share any information that: </p>\r\n<ul class=\"ml-4\">\r\n<li>i.	belongs to another person and to which you do not have any legal right </li>\r\n<li>ii.	is grossly harmful, harassing, blasphemous, defamatory, obscene, pornographic, invasive of another\'s privacy, hateful, or racially, ethnically objectionable, disparaging, relating or encouraging money laundering or gambling, or otherwise unlawful in any manner what so ever; </li>\r\n<li>iii.	harm minors in any way; </li>\r\n<li>iv.	infringes any patent, trademark, copyright or other proprietary rights or third party\'s trade secrets or rights of publicity or privacy; </li>\r\n<li>v.	violates any law for the time being in force; </li>\r\n<li>vi.	impersonate another person contains software viruses or any other computer code, files or programs designed to interrupt, destroy or limit the functionality of any computer resource; or contains any Trojan horses, worms, time bombs, cancelbots, easter eggs or other computer programming routines that may damage, detrimentally interfere with, diminish value of, surreptitiously intercept or expropriate any system, data or personal information. </li>\r\n</ul>\r\n\r\n<p>You, as a Buyer, understand that upon initiating a transaction you are entering into a legally binding and enforceable contract with Sahyadri Farms to purchase the products and /or services from Sahyadri Farms, and pay the transaction price to Sahyadri Farms using appropriate Payment Facility. You, as a Buyer, understand that the all payment facility may not be available in full or in part for certain category of products and for certain locations and hence you may not be entitled to use that Payment Facility in respect of the transactions for those products or locations. \r\n</p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Availability of Website and its services:</h4>\r\n<p>This Website is controlled and operated by Sahyadri Farms from India and Sahyadri Farms makes no representation that the materials are appropriate or will be available for use in other locations. If you use this web site from outside the India, you are entirely responsible for compliance with all applicable local laws. </p>\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>Access to Website:</h4>\r\n<p>We will do our utmost to ensure that availability of the website will be uninterrupted and that transmissions will be error-free. However, due to the nature of the Internet, this cannot be guaranteed. Also, your access to the website may also be occasionally suspended or restricted to allow for repairs, maintenance, or the introduction of new facilities or services at any time without prior notice. </p>\r\n<p>We will attempt to limit the frequency and duration of any such suspension or restriction. </p>\r\n\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Permission to access website:</h4>\r\n<p>Sahyadri Farms grants you a limited, revocable permission to access and make personal use of this Website, but not to download or modify it, its Contents or any portion of it, except with express written consent of Sahyadri Farms. This permission does not include any resale or commercial use of this website or its contents; any collection and use of any product listings, descriptions, or prices; any derivative use of this website or its contents; any downloading or copying of account information for the benefit of another seller; or any use of data mining, robots, or similar data gathering and extraction tools.</p>\r\n<p>The use of the Website and its Content grants no rights to you in relation to any copyright, designs, trademarks and all other intellectual property and material rights relating to the Content. </p>\r\n<p>The Contents including but not limited to the design, structure, selection, coordination, expression, \"look and feel\" and arrangement of such Content, contained on the Website are original to Sahyadri Farms and are owned and controlled or licensed by us, and are protected by trade dress, copyright, patent and trademark laws, and various other intellectual property rights. Except as expressly provided in Terms of Use, no part of the Website and no Content may be copied, reproduced, republished, uploaded, posted, publicly displayed, encoded, translated, transmitted or distributed in any way (including \"mirroring\") to any other computer, server, website or other medium for publication or distribution or for any commercial enterprise, without our express prior written consent. </p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Applicability of Terms: </h4>\r\n<p>You will be subject to the policies, conditions and Terms of use in force at the time that you use the website or that you order goods from us, unless any change to those policies or these conditions is required to be made by law or government authority (in which case it will apply to orders previously placed by you). </p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Communications:</h4>\r\n<p>When you place order on our Website or send e-mails to us, you are communicating with us electronically so you must provide a valid mobile phone number / email address while placing an order with us. We may communicate with you by e-mail, SMS, phone call or by posting notices on the Website or by any other mode of communication. </p>\r\n<p>For contractual purposes, you consent to receive communications including SMS, e-mails or phone calls from us with respect to your order. \r\n</p></div>\r\n<div class=\"my-3\">\r\n<h4>Your Obligations:</h4>\r\n<p>You shall </p>\r\n<ul class=\"ml-4\">\r\n<li>i.	not acquire any ownership rights by downloading material /Contents from this website.</li>\r\n<li>ii.	read the Terms and policies of website and agree to accept the Terms before use of Website </li>\r\n<li>iii.	abide by the Terms and Policies of Website Neither copy or modify the Contents of the website nor use the Website for commercial purpose purchase the product(s) from this Website for your internal / personal purpose and not for resale by you or any other person</li>\r\n<li>iv.	comply with all applicable laws in connection with your use of the Website, and such further limitations as may be set forth in any written or on-screen notice from us</li>\r\n<li>v.	not refuse to accept the delivery of the Products under your order upon delivery except for damages and deficiencies </li>\r\n<li>vi.	authorize us to declare and provide declaration to any governmental authority on your behalf stating the aforesaid purpose of the products ordered by you on the website. </li>\r\n\r\n</ul>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Products/Services:</h4>\r\n<p>All products/services and information displayed on Website constitute an \"invitation to offer\". Your order for purchase constitutes your \"offer\". All orders placed by you on the Website are subject to availability and acceptance by us and conditional on your acceptance and adherence to these terms and conditions. </p>\r\n\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Our Contract:</h4>\r\n<p>Your order is an offer to us to buy the product(s) in your order. We will confirm our acceptance of your offer either through an e-mail / SMS or through shipment of the items you requested. Upon placing an order, you will receive an e-mail confirming receipt of your order with details (the \"Order Confirmation E-mail\"). </p>\r\n<p>The Order Confirmation E-mail is an acknowledgement that we have received your order, and does not confirm acceptance of your offer to buy the product(s) ordered. Our acceptance to your offer takes place and the contract of sale for a product ordered by you concludes only upon actual dispatch of products to you and an e-mail confirmation in that regard is sent to you (the \"Dispatch E-mail\"). </p>\r\n<p>We, at our sole discretion, reserve our right to limit the quantity of items and cancel any order, even after acceptance. Sahyadri Farms has complete right to accept or reject an order placed online. No act or omission of Sahyadri Farms prior to actual dispatch of the product(s) ordered will constitute an acceptance of your offer. You agree not to dispute the decision of Sahyadri Farms in this regard. \r\n</p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Cancellation of Order:</h4>\r\n<p>You can cancel your order fully or partially anytime up to the cut-off time of the slot for which you have placed an order by calling our customer service. In such a case we will refund any payments already made by you for the order as per the refund policy applicable at that time. For details please refer to our Cancellation Policy on the Website.</p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Price</h4>\r\n<p>All the products listed on the Website will be sold at Indian Rupees either at Maximum Retail Price (MRP) (inclusive of all taxes) or at an Offer/discounted price with taxes, unless otherwise specified. The prices mentioned at the time of ordering will be the prices charged to you on the date of delivery. Although prices of most of the products do not fluctuate on a daily basis but some of the commodities and fresh food products prices do change on a daily basis.</p>\r\n<p>In case of products such as Fresh Food, Vegetables and Fruits etc. the delivered weight may have variance and product will be billed accordingly on the actual weight. There may be cases where M.R.P. of the product delivered is different from the M.R.P. quoted / reflected on the Website due to various reasons including time lag in updating prices post changes in M.R.P. or product belonging to a different batch or different M.R.P.s being used by manufacturers in different regions. Prices and taxes thereon in respect of all products are subject to change from time to time, without prior notice by Sahyadri Farms. We strive to provide you with the best prices possible on our Website.</p>\r\n\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Mode of Payment</h4>\r\n<p>Sahyadri Farms offers you multiple payment options both offline and online. Please refer our Price and Payment Policy document for details </p>\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>Delivery/Shipment of Product:</h4>\r\n<p>Delivery of the Products under your Order in the Website shall be made as per our Delivery/shipment policy mentioned herein. Title of the Product shall pass on to you upon receipt of payment. </p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Mispricing:</h4>\r\n<p>Despite our best efforts, there may be an instance of mispricing of items in our catalogue/offer on Website. However, we verify prices as part of our dispatch procedures. If a product\'s correct price is lower than our stated price, we charge the lower amount and send you the item. If a product\'s correct price is higher than our stated price, you may return at the time of delivery or we may not supply the product unless the problem get resolved and if you do not want to purchase the Product in such higher price we shall cancel your order and refund you the amount paid by you for such cancelled transaction as per existing refund policy. We are committed to and it will be our utmost endeavour not to sell any product at a price higher than the MRP printed on the product pack. However, despite our possible efforts, due to various reasons including technical lapses, time lag on updating price of the Product on website, in case you get billed erroneously at a price higher than MRP printed on the product pack, we shall undertake to refund the difference immediately, as per the company policy.</p>\r\n</div>\r\n\r\n\r\n<div class=\"my-3\">\r\n<h4>Return / Exchange of Products:</h4>\r\n<p>You can return /exchange your purchased products subject to our Return / Exchange policy. </p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Exactness / Accuracy not guaranteed:</h4>\r\n<p>We have made significant efforts to accurately display the colours / dimension / specification of products that appear on the Website. However, we do not warrant/guarantee that product description or other content of this Website is accurate, complete, reliable, current, or error-free. </p>\r\n<p>The particular technical specifications and settings of your computer and its display could affect the accuracy of its display of the colours, dimension, specifications of products offered on this Website. \r\n</p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Copyright:</h4>\r\n<p>All Content included on the website, such as text, graphics, logos, button icons, images, audio clips, digital downloads, data compilations, and software, is the property of Sahyadri Farms, its affiliates or its content suppliers and is protected by the Intellectual Property Laws of India. \r\n</p>\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>Trademarks:</h4>\r\n<p>The trademark Sahyadri Farms, its logo and all products and logos denoted with TM are trademarks owned or registered trademarks of Sahyadri Farms or its affiliates. \r\n</p>\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>Intellectual Property Claims:</h4>\r\n<p>Sahyadri Farms and its affiliates or its content suppliers respect the intellectual property of others. If you believe that your intellectual property rights have been used in a way that gives rise to concerns of infringement, please write to us with your concerns. \r\n</p>\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>Disclaimer:</h4>\r\n<p>You acknowledge and undertake that you are accessing the services on the Website and transacting at your own risk and are using your best and prudent judgment before placing any order or availing the services or entering into any transactions with us through our Website.</p>\r\n<p>We shall not be held liable nor responsible for any representations or warranties/guarantees of the products save and except the limited manufacturer\'s warranty/guarantee on the respective Product is assigned unto us and we hereby expressly disclaim and any all responsibility and liability in that regard. \r\n</p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Severability:</h4>\r\n<p>If any of these Terms is deemed invalid, void or unenforceable in whole or in part for any reasons, such invalidity or unenforceability condition or part thereof will be deemed severable and will not affect the validity and enforceability of any remaining condition or part of such condition / Terms.\r\n</p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Amendments:</h4>\r\n<p>Sahyadri Farms reserves its right to amend the Website, Policies, Conditions or Terms of use and at any time without prior notice. All such updates and amendments shall be posted on the Website and will be effective from the time of its posting on the Website. You are advised to regula