 Agreement be it in tort or contract is limited to the value of the product ordered by you. However in case of missing a delivery in transit, Our liability is limited only to delivery at a later agreed time at no additional charge.</p>\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>Waiver:</h4>\r\n<p>Our failure to enforce any provision of the Terms or respond to a breach by you shall not in any way waive our right to enforce subsequently any provision of the Terms or to act with respect to similar breaches. \r\n</p>\r\n</div>\r\n<div class=\"my-3\">\r\n<h4>Reserved Rights of Sahyadri Farms:</h4>\r\n<p>We may discontinue this Website at any time and for any reason, without notice. All rights not expressly granted herein are hereby reserved to us. </p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Applicable Law:</h4>\r\n<p>Any dispute arising out of these terms and conditions, user agreement, privacy policy or the documents they incorporate by reference and/or your use of the Website shall be governed and construed in accordance with the laws of India, notwithstanding any conflicts of law. </p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>Jurisdiction:</h4>\r\n<p>You specifically consent to submit any dispute arising out of these terms and conditions/User agreement to the jurisdiction of courts of Nashik District, India. </p>\r\n</div>\r\n\r\n<div class=\"my-3\">\r\n<h4>TERM & TERMINATION:</h4>\r\n\r\n<p>This User Agreement shall be effective form the date and time of your acceptance of the Terms of the Website and remain in force unless and until terminated by either of us. You may terminate this Agreement at any time, provided that you discontinue any further use of this Site. </p>\r\n<p>We may terminate this User Agreement at any time and may do so immediately without notice, and accordingly deny you access to the Site, Such termination will be without any liability to us. Upon any termination of the User Agreement by either of us, you must promptly destroy all materials downloaded or otherwise obtained from this Site, as well as all copies of such materials, whether made under the User Agreement or otherwise.</p>\r\n<p>Any such termination of the User Agreement shall not cancel your obligation to pay for the product already ordered from the Site or affect any liability that may have arisen under the User Agreement. \r\n</p>\r\n</div>\r\n                </div>\r\n            </div>\r\n        </div>');
